import React, { Component } from 'react'
import './todo.css';

export default class todo extends Component {
    render() {
        return (
            <div className="container">
                <div className="col-12 mt-40">
                <div className="col-6 mx-auto formWrapper">
                    <h2 className="text-center heading"> Create A Task</h2>
                    <hr/>
                    <form className="form-group">
                        <input type="text" placeholder="Enter New Task" className="form-control"/>
                        <button type="submit" class="btn btn-primary my-4 float-right">Submit</button>
                    </form>
                </div>
                </div>
            </div>
        )
    }
}
